import React, { useState, useEffect } from "react";

export default function Registor() {
  return (
    <div>
      <form>
        <div className="flex">
          <label>คำนำหน้า</label>
          <input type="text" placeholder="" />
          <label>ชื่อ</label>
          <input type="text" placeholder="ชื่อ" />
          <label>นามสกุล</label>
          <input type="text" placeholder="นามสกุล"></input>
        </div>
      </form>
    </div>
  );
}
